const localhost = "http://127.0.0.1:8000";

const apiURL = "/user";

export const endpoint = `${localhost}${apiURL}`;

export const employeesListURL = `${endpoint}/employees/`;
export const emploryeeURL = id => `${endpoint}/employee/${id}/`;
export const employeeCreateURL = `${endpoint}/employee-create/`;
export const employeeUpdateURL = id => `${endpoint}/employees-update/${id}/`;
export const mployeeDeleteURL = id => `${endpoint}/employees-delete/${id}/`;
